<span class="line"><span class="token keyword">echo</span> <span class="token string double-quoted-string">&quot;Status : &quot;</span> <span class="token operator">.</span> <span class="token variable">$response</span><span class="token operator">-&gt;</span><span class="token function">success</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">.</span> <span class="token constant">PHP_EOL</span><span class="token punctuation">;</span></span>
